webpackJsonp([84212657867409],{629:function(e,a){e.exports={data:{site:{siteMetadata:{title:"weiran.co",author:"Weiran Zhang"}},markdownRemark:{id:"/Users/weiran/git/weiran/weiran.co/src/pages/blog/2012/7/11/tweetbot-for-mac-alpha-released/index.md absPath of file >>> MarkdownRemark",html:'<p>The best Twitter app for iPhone and iPad is now on the Mac. A <a href="http://tapbots.com/tweetbot_mac/">public alpha has been released today</a>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/bde7b92c-535f-414b-a002-29e7e72424fa-2a5e56d5c70782156ea8d54b594e36dc-945ba.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 570px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 120.52631578947368%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="bde7b92c 535f 414b a002 29e7e72424fa"\n        title=""\n        src="/static/bde7b92c-535f-414b-a002-29e7e72424fa-2a5e56d5c70782156ea8d54b594e36dc-945ba.png"\n        srcset="/static/bde7b92c-535f-414b-a002-29e7e72424fa-2a5e56d5c70782156ea8d54b594e36dc-98b2c.png 148w,\n/static/bde7b92c-535f-414b-a002-29e7e72424fa-2a5e56d5c70782156ea8d54b594e36dc-5f8e6.png 295w,\n/static/bde7b92c-535f-414b-a002-29e7e72424fa-2a5e56d5c70782156ea8d54b594e36dc-945ba.png 570w"\n        sizes="(max-width: 570px) 100vw, 570px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>More from the <a href="http://tapbots.com/blog/tweetbot/tweetbot-for-mac">Tapbots blog</a>:</p>\n<blockquote>\n<p>“We’ve decided to release it as a public alpha to a) motivate us to finish faster, and b) get feedback to help us build the best Mac incarnation of Tweetbot we can make.”</p>\n</blockquote>\n<p>One has to wonder if this is a preemptive move by Tapbots to gather public support against <a href="https://dev.twitter.com/blog/delivering-consistent-twitter-experience">Twitter’s attack on client apps</a>.</p>',frontmatter:{title:"Tweetbot for Mac Alpha released",date:"July 11, 2012",passthroughUrl:null}}},pathContext:{slug:"/blog/2012/7/11/tweetbot-for-mac-alpha-released/",previous:null,next:{fields:{slug:"/blog/2012/7/tim-cook-at-sun-valley-conference/"},frontmatter:{title:"Tim Cook at Sun Valley Conference, 'Looking Forward' to Meetings with Media Executives",passthroughUrl:null,type:null}}}}}});
